!(function () {
	"use strict";
	class e {
		static initValidation() {
			One.helpers("jq-validation"),
				jQuery(".js-validation-signin").validate({
					rules: {
						"username": { required: !0, },
						"password": { required: !0,  },
					},
					messages: {
						"username": {
							required: "Please enter a username",
						
						},
						"password": {
							required: "Please provide a password",
						
						},
					},
				});
		}
		static init() {
			this.initValidation();
		}
	}
	One.onLoad(() => e.init());
})();
